import React, { useState } from 'react';
import './index.css';

function App(){
    const state = useState();
    const [count, setCount] = useState(0);
    function IncNum(){
        setCount(count+1);
        setCount(count => count+1);
    }
    return (<>
        <h1> {count} </h1>
        <button onClick={IncNum}>Click me</button>
    </>);
}
export default App;
